import { BrowserRouter, Link, Route, Routes } from "react-router-dom"
import "./App.css"
import Home from "./pages/Home.js"



function App() {
  return (
    <div className="app">
      <BrowserRouter>
        <Routes>
          <div
            // if use custom scroll container, pass ref
            ref={ref}
            style={{
              overflowY: "scroll",
              maxHeight: "200px",
            }}
          >
            <Route element={<Home />} path="/" />
            {/* <Route element={<Studio />} path="/studio" />
          <Route element={<Contacts />} path="/contacts" /> */}
          </div>
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App
